                    <li><NavLink to="/contact">Newsletter</NavLink></li>
                    <li><NavLink to="/contact">Contact</NavLink></li>
                                        </ul>
                </div>
                {/* <span onClick={handleClick} className="navTrigger">
                    <i></i>
                    <i></i>
                    <i></i>
                </span> */}
            </div>
        </nav>
        </header>
    )
}

export default Navbar
